map< HSUInt, HSDouble > CUA306Handler::mUA306BypassVoltages;
HSInt CUA306Handler::mDefaultSampleRate = 100 * 1000;

CUA306Handler::CUA306Handler( CIndexManager *pIndexManager, CFileObserver *pFileObserver, HSInt tIndex ) 
	: mIndexManager( pIndexManager )
{		
	mSampleRate = mDefaultSampleRate;	
	mSampleCount = 16 * 1024;

	mStartChannel = 0;
	mNumChannel = 0;

	mDataThread = NULL;
	mFileThread = NULL;

	mDeviceNum = tIndex;

	mIdentifier.CARD_IDENTIFIER = CARD_UA306;
	mIdentifier.CARD_INDEX = ( HSUChar )tIndex;

	mListBuffer = new CListBuffer( 10 * 1024 * 1024, 0, 2 );
	mListBuffer->SetFileObserver( pFileObserver );

	mHandle = NULL;

	for ( HSInt i = 0; i < 8; i++ )
	{
		mBypassVoltages[ i ] = mUA306BypassVoltages[ i ];
	}

	mCurVirtualHitIndex = 0;
}


CUA306Handler::~CUA306Handler()
{
	if ( mDataThread != NULL )
	{		
		delete mDataThread;
		delete mFileThread;
	}

	if ( mListBuffer != NULL )
	{
		delete mListBuffer;
	}	
}

HSVoid CUA306Handler::SetParam( HSInt tSampleRate )
{
	mSampleRate = ( tSampleRate >= 0 ? tSampleRate : mSampleRate );
}

HSBool CUA306Handler::Start()
{
	if ( mDataThread != NULL && mDataThread->IsPaused() )
	{
		mDataThread->Start();
		return HSTrue;
	}

	if ( !IsOn() )
	{
		return HSFalse;
	}	

	mHandle = OpenUA300();
	if ( mHandle == NULL )
	{
		return HSFalse;
	}		

	mCurVirtualHitIndex = 0;
	mFrameCount = 0;

	mDataThread = new CThreadControlEx< CUA306Handler >( this, 0, DATA_THREAD_ID );	
	mFileThread = new CThreadControlEx< CUA306Handler >( this, 0, FILE_THREAD_ID );	

	mListBuffer->SetCardIdentifier( this->Identifier() );
	mListBuffer->Reset( 1 );

	mArgsInfo.clear();

	time( &mStartTime );	

	startad( mHandle, ( HSShort )mStartChannel, ( HSShort )mNumChannel, ( HSUShort )( 6000000 / mSampleRate ), 0 );	

	mDataThread->Start();
	mFileThread->Start();	

	return HSTrue;
}

HSVoid CUA306Handler::Pause()
{
	if ( mDataThread != NULL )
	{
		mDataThread->Pause();
	}
}

HSVoid CUA306Handler::Stop()
{
	if ( mDataThread == NULL )
	{
		return;
	}	

	mDataThread->Stop();

	endread2( mHandle );
	CloseUA300( mHandle );

	Sleep( 50 );

	mFileThread->Stop();

	CVirtualHitPosition::SharedInstance()->Finish();
}

HSUInt CUA306Handler::SamplesInFrame( DEVICE_CH_IDENTIFIER tChannelIdentifier )
{
	HSInt tChannels = mIdentifier.NumOfChannels();	
	if ( tChannels == 0 )
	{
		return 0;
	}	

	tChannelIdentifier.ActionAnd( mIdentifier );		

	return mSampleCount / tChannels * tChannelIdentifier.NumOfChannels();
}

HSUInt CUA306Handler::GetChannelData( DEVICE_CH_IDENTIFIER tChannelIdentifier, HSChar *pSrcBuf, HSChar *pDestBuf, HSInt tOffset, HSInt tSamples )
{	
	HSInt tStart = 0;
	HSInt tLength = 0;

	HSInt tChannels = mIdentifier.NumOfChannels();
	mIdentifier.ChannelInfoWithIdentifier( tChannelIdentifier, tStart, tLength );

	HSInt tIndex = tOffset * tChannels;
	HSInt tSamplesHandled = 0;

	while ( tIndex < mSampleCount && tSamplesHandled < tSamples )
	{
		memcpy( &pDestBuf[ tSamplesHandled * 2 ], &pSrcBuf[ ( tIndex + tStart ) * 2 ], 2 * tLength );

		tIndex += tChannels;
		tSamplesHandled += tLength;
	}

	return tSamplesHandled;
}


HSBool CUA306Handler::EffectiveTest( HSChar *pBuffer )
{	
	return HSTrue;	

	srand( ( HSInt )time( 0 ) );

	HSInt tEachSampleSize = this->EachSampleSize();
	/*
	for ( HSInt i = 0; i < mSampleCount; i++ )
	{
		*( HSShort * )&pBuffer[ i * tEachSampleSize ] = ( HSShort )( ( 0 + ( rand() % 10 < 5 ? 1 : -1 ) * ( rand() % 50 ) ) / 1000.0 / 10.0 * 32768.0 );		
	}
	*/
		
	HSInt tTmpValue = 0;
	HSInt tNormalSize = 0;	
	HSInt tHitSize = 0;

	for ( HSInt i = 0; i < mNumChannel; i++ )
	{			
		HSInt tNormalType = rand() % 3;
		GetSavedValue( tNormalType, 0, tNormalSize );

		HSDouble tDelta = ( 10 + ( rand() % 5 ) ) / 15.0;

		for ( HSInt j = 0; j < mSampleCount / mNumChannel; j++ )
		{			
			*( HSShort * )&pBuffer[ ( i + j * mNumChannel ) * tEachSampleSize ] = ( HSShort )( ( GetSavedValue( tNormalType, j % tNormalSize, tTmpValue ) * tDelta ) / 10.0 * 32768.0 );
		}
	}

	mFrameCount++;


	if ( mFrameCount % ( 1 + rand() % 16 ) != 0 )
	{		
		if ( mFrameCount % ( 1 + rand() % 100 ) != 0 )
		{
			HSInt tChannel = rand() % mNumChannel;
			HSDouble tDelta = ( 10 + ( rand() % 5 ) ) / 20.0;

			HSInt tHitType = rand() % 3 + 3;
			GetSavedValue( tHitType, 0, tHitSize );

			HSInt tStart = rand() % 1000;
			HSInt tLength = min( rand() % 500, mSampleCount / mNumChannel - tStart );
			for ( HSInt j = 0; j < tLength; j++ )
			{
				*( HSShort * )&pBuffer[ ( tChannel + ( j + tStart ) * mNumChannel ) * tEachSampleSize ] = ( HSShort )( ( GetSavedValue( tHitType, j % tHitSize, tTmpValue ) * tDelta ) / 10.0 * 32768.0 );
			}
		}

		return HSTrue;
	}

	time_t tCurTiem;
	time( &tCurTiem );	
	if ( tCurTiem - mStartTime < ( 3 * 60 + rand() % 100 ) )
	{
		return HSTrue;
	}

	CVirtualHitPosition *pVirtualHitPosition = CVirtualHitPosition::SharedInstance();

	HSInt tCurHitIndex = mCurVirtualHitIndex;
	HSBool tIncreaseHitIndex = HSTrue;
	if ( mCurVirtualHitIndex > 0 && mCurVirtualHitIndex % ( 1 + rand() % 16 ) == 0 )
	{
		tCurHitIndex = rand() % mCurVirtualHitIndex;
		tIncreaseHitIndex = HSFalse;
	}

	CVirtualHitPosition::HIT_INFO tHit;
	if ( !pVirtualHitPosition->HitWithIndex( tCurHitIndex, tHit ) )
	{
		//HS_INFO( "Finish show Hits: %d", tCurHitIndex );
		return HSTrue;
	}	
		
	HSBool tDefuse = HSFalse;
	for ( HSInt i = 0; i < mNumChannel; i++ )
	{
		tDefuse = HSTrue;
		for ( HSInt j = 0; j < 3; j++ )
		{
			if ( i == tHit.Channels[ j ] )
			{
				tDefuse = HSFalse;
				break;
			}
		}

		if ( tDefuse && ( ( rand() % 3 ) % 2 == 0 ) )
		{
			continue;
		}

		HSInt tHitType = rand() % 3 + 3;
		GetSavedValue( tHitType, 0, tHitSize );

		HSDouble tDelta = ( 10 + ( rand() % 5 ) ) / 30.0;		
		//HSInt tStart = 16 * 1024 / mNumChannel - tLength - ( rand() % 500 );
		HSInt tStart = rand() % 1000;
		HSInt tLength = min( tHitSize - rand() % 100, mSampleCount / mNumChannel - tStart );
		for ( HSInt j = 0; j < tLength; j++ )  
		{
			*( HSShort * )&pBuffer[ ( i + ( j + tStart ) * mNumChannel ) * tEachSampleSize ] = ( HSShort )( ( GetSavedValue( tHitType, j % tHitSize, tTmpValue ) * tDelta ) / 10.0 * 32768.0 );
			//+ ( rand() % 10 < 5 ? 1 : -1 ) * ( rand() % 50 ) / 1000.0;
		}
	}

	map< HSInt, HSBool > tChannelPass;

	HSDouble tValue = 0;
	for ( HSInt i = 0; i < mSampleCount; i++ )
	{		
		tValue = this->VoltageWithPointer( &pBuffer[ i * tEachSampleSize ] );
		HSInt tChannel = mStartChannel + i % mNumChannel;
		if ( tValue > mBypassVoltages[ tChannel ] || tValue < -mBypassVoltages[ tChannel ] )
		{
			tChannelPass[ tChannel ] = HSTrue;
		}

		if ( tChannelPass.size() == mNumChannel )
		{
			break;
		}
	}

	for ( HSInt i = 0; i < 3; i++ )
	{
		if ( tChannelPass.find( tHit.Channels[ i ] ) == tChannelPass.end() )
		{
			return HSTrue;
		}
	}

	//HS_INFO( "Add Hit With Index: %d", mCurVirtualHitIndex );

	CArgTableManager::ArgItem tArgItem;
	memset( &tArgItem, 0, sizeof tArgItem );

	HSChar *pSaveBuf = ( HSChar * )&tArgItem;
	HSInt tSaveBufLength = sizeof( tArgItem );

	tArgItem.NBeginTime = mFrameCount;
	tArgItem.NBeginTime *= ( mSampleCount/* / mNumChannel*/ );
	tArgItem.NBeginTime *= 1000000000;
	tArgItem.NBeginTime /= mSampleRate;

	tArgItem.RingCount = 16;
	tArgItem.IncreaseNTime = 16;
	tArgItem.NDuration = 16;
	tArgItem.Energy = tHit.Energy + ( tIncreaseHitIndex ? 0 : rand() % 500 );
	tArgItem.Amplitude = tHit.Z;
	tArgItem.HASL = tHit.Y + ( tIncreaseHitIndex ? 0 : ( rand() % 10 > 5 ? 1 : -1 ) * ( rand() % 8 ) );
	tArgItem.HRMS = tHit.X + ( tIncreaseHitIndex ? 0 : ( rand() % 10 > 5 ? 1 : -1 ) * ( rand() % 8 ) );

	for ( HSInt i = 0; i < 3; i++ )
	{
		HSChar *pBuf = NULL;
		if ( mListBuffer->BeginWrite( pBuf, tSaveBufLength ) )
		{
			memcpy( pBuf, pSaveBuf, tSaveBufLength );
			HSUInt tIndex = 0;
			HSUInt tOffset = 0;
			mListBuffer->FinishWrite( tSaveBufLength, tIndex, tOffset );

			DEVICE_CH_IDENTIFIER tChannelIdentifier = Identifier();
			tChannelIdentifier.InitChannel( tHit.Channels[ i ] );
			tChannelIdentifier.TYPE = DEVICE_CH_IDENTIFIER::CHANNEL_DATA_TYPE_ARG;
			mIndexManager->AddIndex( tChannelIdentifier, tIndex, tOffset, tSaveBufLength );

			//HS_INFO( "Add Arg, Identifier: %s, Time: %lld", tChannelIdentifier.ToString().c_str(), tArgItem.NBeginTime );

			tArgItem.NBeginTime += 100;
		}
	}

	mCurVirtualHitIndex += ( tIncreaseHitIndex ? 1 : 0 );

	return HSTrue;
}

HSBool CUA306Handler::ThreadRuning( HSInt tThreadID )
{
	if ( tThreadID == FILE_THREAD_ID )
	{
		HSChar *pBuf;
		HSInt tLength = 0;
		HSInt tBufferIndex = mListBuffer->BeginReadBuffer( pBuf, tLength );
		if ( tBufferIndex >= 0 ) 
		{
			mListBuffer->FileObserver()->Update( this->Identifier(), pBuf, tLength );
			mListBuffer->FinishReadBuffer( tBufferIndex );
		}
		else
		{
			Sleep( 10 );
		}

		return HSTrue;
	}

	HSInt tSampleLength = mSampleCount * this->EachSampleSize();	

	HSChar *pBuf = NULL;
	if ( !mListBuffer->BeginWrite( pBuf, tSampleLength ) )
	{
		HS_ERROR( "Begin Write Get Buffer Error!\n" );
		return HSTrue;
	}

	readdata2( mHandle, ( short * )pBuf, mSampleCount );

	if ( EffectiveTest( pBuf ) )
	{	
		HSUInt tIndex = 0;
		HSUInt tOffset = 0;
		mListBuffer->FinishWrite( tSampleLength, tIndex, tOffset );
		mIndexManager->AddIndex( mIdentifier, tIndex, tOffset, tSampleLength );
	}

	//Sleep( 10 );

	return HSTrue;
}

HSVoid CUA306Handler::ThreadWillStop( HSInt tThreadID )
{
	if ( tThreadID == FILE_THREAD_ID )
	{
		HSChar *pBuffer = NULL;
		HSInt tLength = 0;
		if ( mListBuffer->WritingBuffer( pBuffer, tLength ) )
		{
			mListBuffer->FileObserver()->Update( this->Identifier(), pBuffer, tLength );
		}

		delete mFileThread;
		mFileThread = NULL;

		return;
	}

	if ( mDataThread != NULL )
	{			
		delete mDataThread;
		mDataThread = NULL;
	}
}


HSString CUA306Handler::Name()
{
	HSChar tNameBuf[ 32 ];
	sprintf_s( tNameBuf, "PXDAQ160258-%02d", mDeviceNum + 1 );

	return tNameBuf;
}

DEVICE_CH_IDENTIFIER CUA306Handler::DataIdentifier( DEVICE_CH_IDENTIFIER tChannelIdentifier )
{
	if ( tChannelIdentifier.TYPE == DEVICE_CH_IDENTIFIER::CHANNEL_DATA_TYPE_ARG )
	{
		return tChannelIdentifier;
	}

	return mIdentifier; 
}

HSBool CUA306Handler::OpenChannel( vector< HSInt > &tChannels, vector< HSInt > *pSampleRates, HSString *pErrorMsg )
{
	HSString tErrorInfo = "";	
	if ( tChannels.size() < 1 )
	{
		tErrorInfo = this->Name() + ", 请选择通道! ";		
	}
	else if ( tChannels[ tChannels.size() - 1 ] - tChannels[ 0 ] + 1 != tChannels.size() )
	{
		tErrorInfo = this->Name() + ", 请选择连续通道! ";
	}	

	if ( tErrorInfo != "" )
	{
		if ( pErrorMsg )
		{
			*pErrorMsg = tErrorInfo;
		}
		return HSFalse;
	}

	for ( HSUInt i = 0; i < tChannels.size(); i++ )
	{
		mIdentifier.CH_IDENTIFIER[ 0 ] |= ( 1 << tChannels[ i ] );
	}

	mStartChannel = tChannels[ 0 ];
	mNumChannel = tChannels.size();

	if ( pSampleRates != NULL )
	{
		mSampleRate = ( *pSampleRates )[ 0 ];
	}

	return HSTrue;
}

HSBool CUA306Handler::CloseAllChannel()
{
	mIdentifier.CH_IDENTIFIER[ 0 ] = 0;
	mStartChannel = 0;
	mNumChannel = 0;

	return HSTrue;
}

HSVoid CUA306Handler::SetBypassVoltage( HSUInt tChannel, HSDouble tVoltage )
{
	mDefaultSampleRate = mSampleRate;

	mUA306BypassVoltages[ tChannel ] = tVoltage;
	CArgHandler::SetBypassVoltage( tChannel, tVoltage );	
}

HSInt CUA306Handler::GetDevice( vector< IDataHandler * > *pDevices, CIndexManager *pIndexManager, CFileObserver *pFileObserver )
{
	HANDLE tHandle = OpenUA300();
	if ( tHandle != NULL )
	{		
		CUA306Handler *pUA306 = new CUA306Handler( pIndexManager, pFileObserver );
		pDevices->push_back( pUA306 );

		HS_INFO( "Find Device: PXDAQ160258" );

		CloseUA300( tHandle );

		return 1;
	}		

	return 0;
}

HSBool CUA306Handler::GetDevice( DEVICE_CH_IDENTIFIER tIdentifier, HSUInt tVersion, HSInt64 tDeviceSavePos, vector< HSInt > &tChannels, vector< IDataHandler * > *pDevices, CIndexManager *pIndexManager, CFileObserver *pFileObserver )
{	
	HSInt tIndex = tIdentifier.CARD_INDEX;
	HSInt tCardIdentifier = tIdentifier.CARD_IDENTIFIER;

	switch ( tCardIdentifier )
	{
	case CARD_UA306:
		{
			CUA306Handler *pUA306 = new CUA306Handler( pIndexManager, pFileObserver );			

			pUA306->ListBuffer()->SetCardIdentifier( pUA306->Identifier() );	
			pUA306->ListBuffer()->InitWithFile();

			pDevices->push_back( pUA306 );

			HS_INFO( "Open Device: PXDAQ160258" );
		}
		return HSTrue;

	default:
		return HSFalse;
	}
}

HSVoid CUA306Handler::Save( CINIConfig *pIniConfig )
{
	HSChar tBuf[ 1024 ];
	for ( HSInt i = 0; i < 8; i++ )
	{
		sprintf_s( tBuf, "CHANNEL%d-ThreadHold", i );
		pIniConfig->SetValue( tBuf, mUA306BypassVoltages[ i ], "PXDAQ160258 Setting" );
	}
	
	pIniConfig->SetValue( "SampleRate", mDefaultSampleRate, "PXDAQ160258 Setting" );
}

HSVoid CUA306Handler::Load( CINIConfig *pIniConfig )
{
	HSChar tBuf[ 1024 ];
	for ( HSInt i = 0; i < 8; i++ )
	{
		mUA306BypassVoltages[ i ] = 0.0501191;
		sprintf_s( tBuf, "CHANNEL%d-ThreadHold", i );
		pIniConfig->ValueWithKey( tBuf, mUA306BypassVoltages[ i ], "PXDAQ160258 Setting" );
	}
	
	pIniConfig->ValueWithKey( "SampleRate", mDefaultSampleRate, "PXDAQ160258 Setting" );
}

